import React from 'react'

const Cards = () => {
  return (
    <>
        <div className="card">
            <img src="./Images/med1.jpg" alt="MedicineName" />
            <h3>MedicineName</h3>
            <h4>Rs100</h4>
            <h5>Get 13%off..</h5>
            
        </div>
    </>
  )
}

export default Cards;
